let image = "data:image/svg+xml;base64,";

function cree(el,donnees)
{
	let d = document.createElement(el);
	if(donnees !== undefined){
		for (let a in donnees){
			d.setAttribute(a,donnees[a]);
		}
	}
	return d;
}


function metsTexte(leNoeud, leTexte){
    while (leNoeud.firstChild) {
        leNoeud.removeChild(leNoeud.lastChild);
    }
    leNoeud.appendChild(document.createTextNode(leTexte));
}


function envoieReponse(msg){
    msg.typeMessage = "reponseDialogue";
    window.postMessage(msg);
}

class Druide_Dialogue extends HTMLElement {
	constructor(){
		super();
		// shadow root
		this.attachShadow({mode : 'open'});
        this.close = this.close.bind(this);
  }

  connectedCallback() {
    const { shadowRoot } = this;
    const perisprit = shadowRoot;
    
	const style = document.createElement('style');

	style.textContent = `
        .cadre {
            position: fixed;
            left: 0;
            top: 0;
            width: 100%;
            height: 100%;
            @charset "utf-8";
          }

        .dialogue_message {
            color: #3F4144;
            font-family: "Open Sans", Helvetica, Tahoma, Geneva, Arial, sans-serif;
            font-weight: 100;
            margin: 20;
            padding: 20;
            background-color: #FFF;
            font-size: 16px;
            -webkit-font-smoothing: antialiased
            position: relative;
            top: 150px;
            left: 150px;
            @charset "utf-8";
        }
        
        td.info {
            font-weight: bold;
        }
        
        td.explication {
            word-break:keep-all;
        }
        
        #table_dialogue {
            margin-left: 0px;
            margin-right: 0px;
            padding: 5px;
            border-spacing: 5px;
            border: 0px;
            width: 500px;
            font-size: 13px;
            border-radius: 5px;
            @charset "utf-8";
        }
        
        #table_texte {
            margin-left: 0px;
            margin-right: 0px;
            padding: 0px;
            border: 0px;   
            @charset "utf-8";
        }
        
        #dialogue_druide {
            width: 480px;
            padding: 20px ;
            border: 5px solid ;
            border-radius: 6px;
            border-color: rgb(212, 216, 217);  
            box-shadow: 5px 10px 18px #bdb6b6;
            @charset "utf-8";
        }
        
        #serie_boutons {
            text-align: right;
        }
        
        ._svg {
            width: 64px; 
            height: auto;
        }
        
        .sur_ligne {
            display: inline;
            display: inline-block;
        }
        
        .bouton_dialogue {
            width: auto;
            margin: 10px;
            padding: 10px 10px;
            border: 2px solid;
            border-radius: 6px;
            border-color: rgb(212, 216, 217);
            text-align: center;
            -webkit-user-select: none; /* Safari */
            user-select: none; /* Standard syntax */
        }
        
        .bouton_dialogue:hover {
            background-color: rgb(212, 216, 217);
            transition: .5s ease;
        }
        
        .dialogue_message{
            transition: opacity 1s;
        }
        
        .case_image {
            margin-left: auto;
            margin-right: auto;
            vertical-align:center;
            width: 25%;
        }
        
        .colonne_droite {
            width:10px;
        }
        
        a {
            font-weight: bold;
            color: #4AC1F4
        }            
		`;		
    perisprit.appendChild(style);

    let unIDParent = this.id;
    let zIndexMax = this.getAttribute("zdruide");
    let chemin = "";
    
    let cadre  = cree("div",{id:"cadre_dialogue",class:"cadre"});
    cadre.style.zIndex = zIndexMax + 100;
    let unBody = cree("div",{id:"dialogue_druide", class:"dialogue_message"});
    unBody.style.zIndex = zIndexMax + 101;
    let uneTable = cree("table",{class:"table_dialogue"});
    let uneRangee_1 = cree("tr");
    let uneColonne_2_1 = cree("td",{class:"case_image"});
    let uneColonne_2_2 = cree("td",{class:"colonne_tableau"});
    let uneTableTexte = cree("table",{class:"table_texte"});
    let uneRange_tt_1 = cree("tr",{});
    let uneColonne_tt_1 = cree("td",{id:"titre_message",class:"info"});
    let uneSectionTitre = cree("div");
    let uneRange_tt_2 = cree("tr",{});
    let uneColonne_tt_2 = cree("td",{id:"explication_message",class:"explication"});
    let uneSectionExplication = cree("div");
    let uneColonne_2_3 = cree("td",{class:"colonne_droite"});

    let uneSectionImage = cree("img",{src:image, class:"_svg"});

    uneColonne_tt_1.appendChild(uneSectionTitre);
    uneRange_tt_1.appendChild(uneColonne_tt_1);

    uneColonne_tt_2.appendChild(uneSectionExplication);
    uneRange_tt_2.appendChild(uneColonne_tt_2);
    uneTableTexte.appendChild(uneRange_tt_1);
    uneTableTexte.appendChild(uneRange_tt_2);

    uneColonne_2_1.appendChild(uneSectionImage);
    uneColonne_2_2.appendChild(uneTableTexte);
    uneRangee_1.appendChild(uneColonne_2_1);
    uneRangee_1.appendChild(uneColonne_2_2);
    uneRangee_1.appendChild(uneColonne_2_3);

    uneTable.appendChild(uneRangee_1);
    unBody.appendChild(uneTable);

    let uneSectionBoutons = cree("div",{id:"serie_boutons"});
    let bouton_1 = cree("div",{id:"bouton_1",class:"bouton_dialogue sur_ligne"});
    let bouton_2 = cree("div",{id:"bouton_2",class:"bouton_dialogue sur_ligne"});
    let bouton_3 = cree("div",{id:"bouton_3",class:"bouton_dialogue sur_ligne"});
    uneSectionBoutons.appendChild(bouton_3);
    uneSectionBoutons.appendChild(bouton_2);
    uneSectionBoutons.appendChild(bouton_1);

    unBody.appendChild(uneSectionBoutons);

    cadre.appendChild(unBody);
    perisprit.appendChild(cadre);
		
    bouton_1.style.display = "none";
    bouton_2.style.display = "none";
    bouton_3.style.display = "none";
    unBody.style.display = "none";
    cadre.style.display = "none";

    function clicBouton(ev){
        let retour = this.dataset.retour;
        envoieReponse({reponse:retour}); 
        unBody.style.display = "none";
        cadre.style.display = "none";
    }
    
    bouton_1.addEventListener('click',clicBouton,false);
    bouton_2.addEventListener('click',clicBouton,false);
    bouton_3.addEventListener('click',clicBouton,false);

    window.addEventListener('message', function(e){
        if(e.data.typeMessage=="messageDialogue"){
            let data = e.data;
            if(data && data.id == perisprit.host.id){
                if(data.message == "dialogue"){
                cadre.style.display = "block";
                    unBody.style.display = "block";
                    metsTexte(uneSectionTitre,data.titre_dialogue);
                    metsTexte(uneSectionExplication,data.explication_dialogue);

                    if(data.bouton_ok !== undefined && data.bouton_annuler !== undefined){
                        bouton_1.style.display = "inline-block";
                        bouton_2.style.display = "inline-block";
                        if(data.plateforme == "mac"){
                            metsTexte(bouton_1,data.bouton_ok.texte_dialogue);
                            metsTexte(bouton_2,data.bouton_annuler.texte_dialogue);
                            bouton_1.dataset.retour = data.bouton_ok.retour;
                            bouton_2.dataset.retour = data.bouton_annuler.retour;
                        }else{
                            metsTexte(bouton_2,data.bouton_ok.texte_dialogue);
                            metsTexte(bouton_1,data.bouton_annuler.texte_dialogue);
                            bouton_2.dataset.retour = data.bouton_ok.retour;
                            bouton_1.dataset.retour = data.bouton_annuler.retour;
                        }
                    }else if(data.bouton_ok !== undefined && data.bouton_annuler === undefined){
                        bouton_1.style.display = "inline-block";
                        metsTexte(bouton_1,data.bouton_ok.texte_dialogue);
                    }

                    if(data.bouton_info !== undefined){
                        bouton_3.style.display = "inline-block";
                        metsTexte(bouton_3,data.bouton_info.texte_dialogue);
                        bouton_3.dataset.retour = data.bouton_info.retour;
                    }
                }
            }
        }
    },false);

    this.open = this.open;

  }


  disconnectedCallback() {
  }
  
  set open(isOpen) {   
  }

  close() {
    this.open = false;
  }

  _watchEscape(event) {
    if (event.key === 'Escape') {
        this.close();   
    }
  }


}

customElements.define('druide-dialogue', Druide_Dialogue);



